css:
@-moz-document domain("radio.yandex.ru") {
.page-root, .page-root__content {
    background: #000;
}
.logo__ya {
    width: 65px;
    background-image: url(https://az594751.vo.msecnd.net/cdn/Yandex.svg);
    background-size: 60px 60px;
    background-position: left -12px;
}
.link {
    color: #FFF;
}
.logo__service {
    width: 75px;
    background-image: url(data:image/png;base64,
);
    background-size: 48px 48px;
}
*[class*="icon"] {
    -webkit-filter: invert(100%);
}
.button {
    color: #FFF!important;
    border: 1px solid rgba(255, 255, 255, 0.2);
}
.button_transparent {
    border: 1px solid rgba(255, 255, 255, 0.2);
}
.button:hover {
    color: #FFF!important;
    border: 1px solid rgba(255, 255, 255, 0.3);
}
.button_transparent:hover {
    border: 1px solid rgba(255, 255, 255, 0.3);
}
.page-station__title {
    color: #FFF;
}
.volume__control {
    color: #FFF;
    background-color: #112;
}
.volume__bar {
    color: #FFF;
    background-color: #112;
}
.button-arrow.theme1 {
    Color: #FFF;
    background-color: #000;
}
._nb-small-toggler {
    color: #808080;
}
.button_round {
    background-color: rgba(0, 0, 0, 0.7);
}
.button_round:hover {
    background-color: rgba(0, 0, 0, 1);
}
.popup {
    background-color: #112;
}
span {
    color: #808080;
}
.nav__level
{
    background: #1D1B18;
}
.nav__item:hover, .nav__item_selected {
    background: rgba(251,172,56,1);
}
.nav__item:hover span, .nav__item_selected span
{
    color: #000;
}
.button_round.button_checked, .button_round.button_checked:hover {
    background: #565656;
}
.progress__shape_play .progress__path {
    stroke: rgba(255, 255, 255, 0.8);
}

.player-controls__play:hover .progress__path {
    stroke-dasharray: none;
    stroke: rgba(255,255,255,0.9);
}
.track .track__icon, .track .track__cover {
    border-radius: 10%;
}
.select__link, .select__text {
    color: #FFF;
}
.select__item:hover {
    background: #6D6D6D;
}
.slider-vert__filled {
    background: rgb(0, 51, 204);
}
.slider-vert:hover .slider-vert__filled {
    background: #009DCE;
}
.logo__arrow-text {
    color: #fff !important;
}
.player-controls__title {
    color: #fff;
}
*[class*="white"] {
    -webkit-filter: none !important;
}
.track__shim {
    border-radius: 10%;
}
.track__title{
    color: #DDD;
}
}
